import React from "react";
import BabyNamesData from "./BabyNamesData.json";

const Names = (props) => {
  return (
    <div>
      <ul>
        {BabyNamesData.map((x, i) => {
          return (
            <li key={i}>
              {x.name}
              {console.log(x.name)}
            </li>
          );
        })}
      </ul>
    </div>
  );
};
export default Names;
